import React from 'react';
import Separator from '../Separator';
import styles from './ProgressBar.module.scss';
const {
  container,
  heading,
  progressContainer,
  progress,
  barContainer,
  bar,
} = styles;

interface IProgressBar {
  title: string;
  width: number;
}

const ProgressBar = ({ title, width }: IProgressBar) => {
  return (
    <div className={container}>
      <div className={heading}>{title}</div>
      <div className={barContainer}>
        <span className={bar} style={{ width: `${width}%` }}></span>
      </div>

      <div className={progressContainer}>
        <svg className={progress} viewBox="0 0 400 100">
          <path
            className="drop"
            style="fill:none;stroke:#d0d0d0;stroke-width:8;stroke-linecap:round;"
            d="m 20,80 c 0,0 60,-0.001 90,-0.001 30,0 60,0.001 90,0.001 30,0 60,-0.001 90,-0.001 30,0 90,0.001 90,0.001"
          />
          <path
            className="range"
            style="fill:none;stroke:#3cc124;stroke-width:8;stroke-linecap:round;"
            d="m 20,80 c 0,0 60,-0.001 90,-0.001 30,0 60,0.001 90,0.001 30,0 60,-0.001 90,-0.001 30,0 90,0.001 90,0.001"
          />
        </svg>
      </div>
    </div>
  );
};

export default ProgressBar;
